import React, { Component } from 'react';

class Product extends Component {
    render() {
        return (
            <div className="col-4">
                <div className="card text-left">
                    <img className="card-img-top" src="data:image/jpeg;base64," alt="ban phim"/>
                    <div className="card-body">
                    <h5 className="card-title float-left">Ten san pham</h5>
                    <h5 className="card-title float-right">5000</h5>
                    </div>
                </div>
            </div>
            
        );
    }
}

export default Product;
